  Form,
  FormFeedback,
  FormGroup,
  FormText,
  Input,
  Label,
  Row,
} from 'reactstrap';

const FormPage = () => {
  return (
    <Page title="Forms" breadcrumbs={[{ name: 'Forms', active: true }]}>
      <Row>
        <Col xl={12} lg={12} md={12}>
          <Card>
            <CardHeader>Images</CardHeader>
            <CardBody>

            </CardBody>
          </Card>
        </Col>
      </Row>


    </Page>
  );
};

export default FormPage;
